export default function HomePage() {
  return (
    <div>
      <h1>Учебный проект Emmonsha.Online</h1>
      <p>Этот проект создан для изучения:</p>
      <ul>
        <li>Работы с базами данных (PostgreSQL)</li>
        <li>Основ фронтенд-разработки (React)</li>
        <li>Систем аутентификации</li>
        <li>Docker-контейнеризации</li>
      </ul>
      <a href="/auth">Перейти к авторизации</a>
    </div>
  );
}
